import styled from 'styled-components';
import logo from "../assets/logo.png"

export default function Login(){
    return(
        <>
        <Container>
            <img src= {logo} alt="logo" />
        </Container>


        </>
    );
}

const Container = styled.div`
	width: 100px;
	height: 100px;
	background: #FFF;
`;
